INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 2, 109001, "エリコ（バレンタイン）", 0, 10011, "2019/01/31 12:00:00", 24, 4.0, -385.0, 1, 8.0, 24004, 4);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 2, 109001, "エリコ（バレンタイン）", 0, 10011, "2019/01/31 12:00:00", 24, 6.0, -385.0, 1, 8.0, 24005, 5);
