INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, 109002, "エリコ（バレンタイン）", 0, 10011, "2019/01/31 12:00:00", 24, 0.0, 0.0, 1, 0.0, 24010, 10);
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES ("2030/12/17 14:59:59", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 2, 109101, "シズル（バレンタイン）", 0, 10011, "2019/01/31 12:00:00", 24, 2.12, -385.0, 1, 8.0, 24011, 1);
